import React from 'react';

function PageTitleButton({ onClick, color }) {
    return (
        <img
            src='./UI/UI_X.png'
            style={{
                height: "30px",
                position: "absolute", // Anchor to the left
                left: "0", // Align to the left edge of the container
                cursor: "pointer",
                backgroundColor: color,
            }}
            alt="Page Icon"
            onClick={onClick}
        />
    );
}

export default PageTitleButton;
